import React, { Fragment } from 'react'
import { Link } from 'react-router-dom'

export default function Leftbar() {

  const leftSidebarContent = [
    {
      title: 'Questions',
      link: '/questions'
    },
    { 
      title: 'Tags',
      link: '/tags'
    },
    {
      title: 'Users',
      link: '/users'
    },
    {
      title: 'Companies',
      link: '/companies'
    }
  ]
  return (
    <React.Fragment>
    <div className='h-screen bg-stone-700 w-3/12 hidden sm:block'>
      <h4>Public</h4>
      <ul className='text-left py-20 px-3 w-full'>
        {leftSidebarContent.map((item, index) => (
          <li key={index} className='w-full active:bg-gray-700'>
            <Link className='py-2 text-sm  ' to={item.link}>{item.title}</Link>
          </li>
        ))}
      </ul>
    </div>
    </React.Fragment>
  )
}
